dct::~dct() {
    if (mVcdFile) 
        sc_close_vcd_trace_file(mVcdFile);

    mHdltvinHandle << "] " << endl;
    mHdltvoutHandle << "] " << endl;
    mHdltvinHandle.close();
    mHdltvoutHandle.close();
    delete row_outbuf_i_U;
    delete col_outbuf_i_U;
    delete col_inbuf_U;
    delete buf_2d_in_U;
    delete buf_2d_out_U;
    delete read_data_U0;
    delete Loop_Row_DCT_Loop_pr_U0;
    delete Loop_Xpose_Row_Outer_U0;
    delete Loop_Col_DCT_Loop_pr_U0;
    delete Loop_Xpose_Col_Outer_U0;
    delete write_data_U0;
}

